import React from 'react'
import { Container, Input2 } from './Styled'

export default function Email() {
  return (
    <Container>
        <label>

           <span class="nome">E-mail: </span>
           <br/>
           <Input2 type='email' name='email' />

        </label>
    </Container>
  )
}
